package org.redquark.leetcode.challenge;

import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertEquals;

class Problem19_LongestDuplicateSubstringTest {

    private final Problem19_LongestDuplicateSubstring testObject = new Problem19_LongestDuplicateSubstring();

    @Test
    void longestDupSubstring() {
        assertEquals("ana", testObject.longestDupSubstring("banana"));
        assertEquals("", testObject.longestDupSubstring("abcd"));
        assertEquals("mqqqv", testObject.longestDupSubstring(""));
    }
}